import React from 'react';
class Nav  extends React.Component {

    render() { 
        return ( 
            <nav className="nav">
<div className="nav-title">
<h3>BakeMore</h3>
</div>
<div class="nav-btn">
    <label for="nav-check">
      <span></span>
      <span></span>
      <span></span>
    </label>
  </div>

<div id="nav-check">
<ul className="Menu-content" className="nav-links">

    <li><a href="">Home</a></li>
    <li><a href="">Gallery</a></li>
    <li><a href="">Order Online</a></li>
    <li><a href="">About Me</a></li>
    <li><a href="">Contact Me</a></li>
    
</ul>
</div>

            </nav>
            
         );
    }
}
 
export default Nav ;
